#wallet{
    color: #fff
}

.showV, .showHisM{
    display: none;
}

.content .inputGroup .input-append button {
    width: 60px;
    height: 38px;
    background: transparent;
    border: none;
}

.content .inputGroup .input-append {
    position: absolute;
    top: 0;
    right: 0;
    border-top-right-radius: 4px;
    border-bottom-right-radius: 4px;
    overflow: hidden;
}

.content {
    padding: 2rem;
}

.header {
    position: relative;
    background-color: #181c21;
}

.header .leftHeader {
    border-right: 1px solid rgba(255, 255, 255, 0.17);
}

.header .leftHeader, 
.header .rightHeader {
    padding: 2rem;
    flex: 1 auto;
    max-width: 50%;
}

.header .iconTransfer {
    width: 40px;
    height: 40px;
}

.header .changeAmount {
    position: absolute;
    top: 50%;
    left: 50%;
    -webkit-transform: translate(-50%, -50%);
    -ms-transform: translate(-50%, -50%);
    -moz-transform: translate(-50%, -50%);
    transform: translate(-50%, -50%);
}

.sectionTable {
    padding-top: 6rem;
}

.contentBox .background.backgroundLive {
    background-color: #2e3c4c;
    background-image: url('~@/assets/images/sky/livebanner.png');
}

.contentBox .background.backgroundDemo {
    background-color: #2e3c4c;
    background-image: url('~@/assets/images/sky/winbanner.png');
}

.backgroundImg {
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
}

.contentBox .background {
    position: relative;
    border-radius: 10px;
    background-size: cover;
    background-repeat: no-repeat;
    background-position: center;
}

