.contentBox .background .content{
    border-radius: 5px;
}

.contentBox .wbtn.btn-radius {
    border: 1px solid transparent;
    border-radius: 3px !important;
}

.button.wbtn.btn-large {
    padding: 11px 2.5rem;
}

.button.wbtn {
    display: inline-flex;
    align-items: center;
    justify-content: center;
    background-color: #2177FF;
    color: #fff;
    font-weight: 400;
}

.iconSubmit {
    display: inline-block;
    width: 20px;
    height: 20px;
    background-size: cover;
    background-repeat: no-repeat;
    margin-right: 5px;
}


.iconSubmit.iconSubmitLive {
    background-image: url(data:image/svg+xml;base64,);
}

.iconSubmit.iconSubmitDemo {
    background-image: url(data:image/svg+xml;base64,);
}


.history .box-result-header {
    color: rgba(255, 255, 255, 0.7);
    border-bottom: 1px solid rgba(255, 255, 255, 0.1);
    font-size: 14px;
    padding: 10px 5px;
    height: 50px;
}

.history .box-result .item {
    border-bottom: 1px solid rgba(255, 255, 255, 0.1);
    color: #fff;
    padding: 10px 5px;
    height: 50px;
}

.history .box-result .block-col.amount {
    flex: 0 0 85px;
    max-width: 85px;
}

.history .box-result .block-col.status {
    flex: 0 0 90px;
    max-width: 90px;
}

.history .box-result .block-col p > span {
    line-height: 30px;
}

.history .box-result .item svg {
    width: 14px;
    margin-right: 5px;
    vertical-align: middle;
}

.history .box-result .block-col.amount span {
    padding: 0 10px;
}

.history .box-result .item span {
    font-size: 14px;
}

.history .box-result .block-col > span {
    line-height: 30px;
}

.history .box-result .block-col.note span{
    overflow: hidden;
    white-space: nowrap;
    text-overflow: ellipsis;
    display: block;
    width: 100%;
}

.history .item-txid-desc {
    overflow: hidden;
    text-overflow: ellipsis;
    padding: 0 5px;
    white-space: nowrap;
    display: block !important;
}


.history-nav .nav-tabs {
    border-bottom: 2px solid rgba(255, 255, 255, 0.1);
    position: relative;
}

.history .box-result .block-col > span {
    line-height: 30px;
}

.history .box-result .block-col {
    flex: 1;
    white-space: nowrap;
    overflow: hidden;
    display: inline-block;
    padding-top: 0;
    padding-bottom: 0;
}

.history .box-result .block-col.time {
    flex: 0 0 110px;
    max-width: 110px;
}

.history-body{
    background: #02142b;
    border-radius: 5px;
    border: none;
    padding: 0 !important;
    border: 1px solid rgba(255, 255, 255, 0.15);
}

.boxCoin img, 
.boxCoin .curency-icon {
    max-width: 44px;
    margin-right: 0.5rem;
}

.boxCoin .boxCoinFooter{
    border-color: rgba(255, 255, 255, 0.1);
}

.boxCoin .boxCoinFooter img {
    width: 18px;
    margin-right: 5px;
}

.boxCoin .boxCoinFooter {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 0.75rem;
    border-top: 1px solid #ddd;
    font-size: 0.8rem;
}

.boxCoinFooter a {
    color: #fff;
}

.boxCoin .boxCoin-body {
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 0.75rem;
}


.subBanner{
    color: rgba(255, 255, 255, 0.3);
    height: 160px;
    width: 100%;
    background-color: #2e3c4c;
}

.subBanner .price {
    color: #fff;
    font-size: 2.75rem;
    font-weight: 700;
}

.subBanner .icon {
    display: inline-block;
    background-size: cover;
    width: 36px;
    height: 35px;
    
}


.boxCoin .curency-icon.PAYPAL,
.subBanner .icon.PAYPAL {
    background-image: url(data:image/png;base64,);
}

.boxCoin .curency-icon.USDT,
.subBanner .icon.USDT {
    background-image: url(data:image/png;base64,);
}

.boxCoin .curency-icon.ETH,
.subBanner .icon.ETH {
    background-image: url(data:image/svg+xml;base64,);
}

.boxCoin .curency-icon.BTC,
.subBanner .icon.BTC {
    background-image: url(data:image/svg+xml;base64,);
}


.boxCoin .curency-icon {
    width: 44px;
    height: 44px;
    background-position: center;
    background-size: contain;
    background-repeat: no-repeat;
}

.boxCoin {
    color: #fff;
    border-radius: 5px;
    border: 1px solid rgba(112, 112, 112, 0.3);
    background-color: #02142b;
}

@media only screen and (max-width: 768px) {
    .history-body{
        overflow-x: auto;
    }
    .subBanner .info{
        justify-content: center;
    }
    .showHisM {
        overflow-x: auto;
        width: 860px;
    }
}
